import Card from 'react-bootstrap/Card';

function Getlist(props){

 const {listdata} =props
let dat;

if(typeof listdata != "undefined"){
    dat = listdata.map((item, index)=>{
        return <li key={item.id}> {item.title}</li>
 })}

return(
    
    <div>
        <ul>
         {dat}
        </ul>
    </div>
)
}

export default Getlist
